import "./App.css";
import Data from "./components/Data";
import TableOne from "./components/TableOne";
import TableTwo from "./components/TableTwo";

function App() {
  return (
    <div class="row justify-content-center">
      <TableOne />
      <div class="col-md-9">
        <h6>There are {Data.length} movies in the list</h6>
        <TableTwo />
        </div>
    </div>
  );
}

export default App;
